import React, { Component } from 'react';
import $ from 'jquery';
require ('https://unpkg.com/isotope-layout@3/dist/isotope.pkgd.min.js');

class Portfolio extends Component {

  componentDidMount = () => {

    $('button').on('click',function(){
      alert('hello');
    });
  }

  render() {
    return (
    	<div id='portfolio'>
    		<button> hello</button>
    	</div>
    );
  }
}

export default Portfolio;
